    const [number, setNumber] = useState(42)

    return(
            <div>
        <h1>{number}</h1>
                <button onClick={()=>setNumber(prev=>prev+1)}>+</button>
                <button onClick={()=>setNumber(prev=>prev-1)}>-</button>
            </div>
        )

}

export default App;
